import Data from '../../store/data';
import "./menu.css"
const Menu = () => {
  return(
    <div className='main'>
      <div className='child'>
        <ul style={{listStyleType: "none"}}>
          {Data.map((item, index) => <Item key = {index} item = {item} />)}
        </ul>
      </div>
      <Image className="image"/>
        <Summary/>
    </div>
  )
}


export default Menu;
